css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain(youtube.com) {

/* remove header ad */
#header {display: none !important; /*visibility: collapse !important;*/ height: 0px !important; border: 0 !important;}
#masthead_child {display: none !important; /*visibility: collapse !important;*/height: 0px !important; border: 0 !important;}
.branded-page-v2-detached-top .branded-page-v2-container {margin-top: 0px !important;}



/* logo */
#logo {background: url(
data:image/png;base64,

) !important;
background-position: 0 0 !important;
background-size: 76px 30px  !important;
margin: 0 0 !important;}
.content-region {display: none !important;}



/* header */
#yt-masthead-container {background: url(
data:image/png;base64,

) !important;
border-bottom: none !important;
}


/* side-bar */
#guide-container {
position: absolute !important;
left: -45px !important;
top: -20px !important;
padding-bottom: 30000px !important;
padding-top: 20px !important;
padding-left: 61px !important;
background: url(
data:image/png;base64,

) !important;
overflow: hidden !important;}
#guide-main {top: 20px !important;}
#watch-context-container {top: 20px !important;}

/* side-bar text color */
#guide a{color: #eee !important;}
.guide-context-item .title {color: #eee !important}
.guide-context-item.context-playing a  {background-color: rgb(65,65,65) !important; border: 0 !important;}
.guide-context-item:hover .title {color: #222 !important;}
.guide-context-item .username {color: #bbb !important;}
.guide-context-item .viewcount {color: #bbb !important;}
.guide-context-item:hover .username {color: #777 !important;}
.guide-context-item:hover .viewcount {color: #777 !important;}
.guide-module-toggle {color: #eee !important;}
li.guide-section h3 {color: #ddd !important;}
#guide-subs-footer-container .yt-uix-form-input-text {color: #fff !important;}
#guide-filter-no-results {color: #ddd !important}

/* header content */
#masthead-search-terms {
color: #EEE !important;
background-color: transparent !important;
border-bottom: 2px solid rgb(0,144,185) !important;
border-left: 0px !important;
border-right: 0px !important;
border-top: 0px !important;
box-shadow: 0 0 !important;
}
#masthead-search-term {
color: #DDD !important;
}
#yt-masthead .yt-uix-button-hh-default {
background: transparent !important;
color: #111 !important;
}
#masthead-upload-button-group .yt-uix-button-default {
color: blue !important;
text-shadow: none !important;
background: none !important;
border: none !important;
}
#masthead-upload-button-group a.yt-uix-button-default .yt-uix-button-content  {
color: rgb(102, 102, 102) !important;
}

#search-btn {
border-bottom: 2px solid rgb(0,144,185) !important;
border-left: 2px dashed rgb(0,144,185) !important;
border-right: 0px !important;
border-top: 0px !important;
background: none !important;
}

#page-container {
overflow: hidden !important;
}

#masthead-upload-button-group .yt-uix-button-hh-default {
border: none !important;
}
#search-btn .yt-uix-button-content {
background-image: url(
data:image/png;base64,

) !important;
background-position: 0px 0px !important;
background-size: 20px 20px !important;
height: 20px !important;
width: 20px !important;
}
#gs_ok0 {
background: url(
data:image/png;base64,

) !important;}

}
